import './App.css';
import Title from "./Pages/home_page/Title";
import {Fragment} from "react";
import Nav_bar from "./Pages/home_page/layout/nav_bar";
import Login_page from "./Pages/login_display/login_page";
import NewPatientPage from "./Pages/new_patient/new_patient_detail_page";

function App() {
    let Component
    switch (window.location.pathname) {
        case '/':
            Component = <App/>
            break
        case '/Login':
            Component = <Login_page/>
            break
        case '/Register':
            Component = <NewPatientPage/>
            break
    }
    return (
            <Title/>
    )

}

export default App;
